import './List.sass';
import search from '../../../icons/search.svg';
import { useState } from 'react';
import UpdateList from './updateList/UpdateList';
import EditForm from './editForm/EditForm';

const List = () => {

	const [itemId, setItemId] = useState();

	const getId = (id: any) => {
		setItemId(id);
	}

	return (
		<div className='list'>
			<EditForm itemId={itemId}></EditForm>
			<div className='search-panel'>
				<div className="search-panel__search">
					<input type='text' placeholder='Пошук...' />
					<img src={search} alt="magnifier" className="search-panel__search__icon"/>
				</div>
				<div className="search-panel__sort">
					<button>сума<span id="sortIcon"></span></button>
					<button>дата<span id="sortIcon"></span></button>
				</div>
			</div>  
			<div className='table'>
				<table className='list__table'>
					<UpdateList getItemId={getId}/>
				</table>
			</div>
		</div>
)}
  

export default List;
